import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';

const workoutSplits = {
  "Full Body": ["Legs", "Back", "Chest", "Shoulders", "Arms", "Core"],
  "Upper/Lower": ["Upper Body", "Lower Body"],
  "Push/Pull/Legs": ["Push (Chest, Shoulders, Triceps)", "Pull (Back, Biceps)", "Legs"],
};

const Exercise = () => {
  const navigate = useNavigate();
  const [userData, setUserData] = useState(null);
  const [selectedSplit, setSelectedSplit] = useState("");
  const [exerciseData, setExerciseData] = useState({});

  useEffect(() => {
    fetch("/api/auth/me")
      .then(res => res.json())
      .then(data => setUserData(data));
  }, []);

  const fetchExercises = async (part) => {
    const url = 'https://exercisedb.p.rapidapi.com/exercises?limit=10&offset=0';
    const options = {
      method: 'GET',
      headers: {
        'x-rapidapi-key': 'b6af6401c7msh507d1ef761e52bep14d56ajsn296ec1db7d38',
        'x-rapidapi-host': 'exercisedb.p.rapidapi.com'
      }
    };

    try {
      const response = await fetch(url, options);
      const result = await response.json();
      return result;
    } catch (error) {
      console.error(error);
      return [];
    }
  };

  const generateWorkoutPlan = async () => {
    if (!selectedSplit || !userData) return;
    const workoutParts = workoutSplits[selectedSplit];
    const generatedData = {};

    for (const part of workoutParts) {
      generatedData[part] = await fetchExercises(part);
    }

    setExerciseData(generatedData);
  };

  return (
    <ExerciseWrapper>
      <Header>
        <span>Exercise</span>
        <HomeButton onClick={() => navigate('/')}>Home</HomeButton>
      </Header>
      <Content>
        <h1>Create Your Workout Plan</h1>
        <button onClick={() => setSelectedSplit("Full Body")}>Create New Workout</button>
        <button onClick={() => navigate('/existing-plan')}>Use Existing Plan</button>

        {selectedSplit && (
          <div>
            <h2>Select Workout Split</h2>
            <select value={selectedSplit} onChange={(e) => setSelectedSplit(e.target.value)}>
              {Object.keys(workoutSplits).map(split => (
                <option key={split} value={split}>{split}</option>
              ))}
            </select>
            <button onClick={generateWorkoutPlan}>Generate Plan</button>
          </div>
        )}

        {Object.keys(exerciseData).length > 0 && (
          <div>
            <h2>Generated Workout Plan</h2>
            {Object.entries(exerciseData).map(([part, exercises]) => (
              <div key={part}>
                <h3>{part}</h3>
                <select>
                  {exercises.map(exercise => (
                    <option key={exercise.id} value={exercise.name}>{exercise.name}</option>
                  ))}
                </select>
              </div>
            ))}
          </div>
        )}
      </Content>
    </ExerciseWrapper>
  );
};

export default Exercise;

const ExerciseWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background: radial-gradient(125% 125% at 50% 10%,rgb(217, 39, 39) 40%, #000 100%);
  color: white;
  text-align: center;
`;

const Header = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 60px;
  background-color: #fff;
  color: black;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 24px;
  font-weight: bold;
  z-index: 1000;
  box-shadow: 0 4px 6px rgb(201, 80, 169);

  span {
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
  }
`;

const HomeButton = styled.button`
  position: absolute;
  right: 20px;
  top: 50%;
  transform: translateY(-50%);
  padding: 8px 16px;
  font-size: 14px;
  font-weight: bold;
  border: .25em solid rgb(217, 176, 255);
  background-color: #fff;
  color: rgb(217, 176, 255);
  border-radius: 1em;
  cursor: pointer;
  transition: all 0.3s;
  box-shadow: 0 0 1em .25em rgb(217, 176, 255),
              0 0 4em 1em rgba(191, 123, 255, 0.5),
              inset 0 0 .75em .25em rgb(217, 176, 255);
  text-shadow: 0 0 .5em rgb(217, 176, 255);

  &:hover {
    background-color: rgb(217, 176, 255);
    color: #222;
  }
`;

const Content = styled.div`
  margin-top: 80px;
  text-align: center;
  h1 {
    font-size: 36px;
    margin-bottom: 20px;
  }
  p {
    font-size: 18px;
  }
  ul {
    list-style: none;
    padding: 0;
  }
  li {
    font-size: 20px;
    margin: 10px 0;
  }
`;
